import PropTypes from 'prop-types'

class Items extends React.Component{
  state={
    itemName: "Item Name", itemPrice: 999
  }

  render () {
    return (
      <div>
        <img Url="https://via.placeholder.com/250" alt=""/>
        <h1>{this.state.itemName}</h1>
        <h4>${this.state.itemPrice}</h4>
      </div>
    )
  }
}

export default Items;
